main.script:
if (typeof Object.assign != 'function') {
  Object.assign = function(target) {
    'use strict';
    if (target == null) {
      throw new TypeError('Cannot convert undefined or null to object');
    }

    target = Object(target);
    for (var index = 1; index < arguments.length; index++) {
      var source = arguments[index];
      if (source != null) {
        for (var key in source) {
          if (Object.prototype.hasOwnProperty.call(source, key)) {
            target[key] = source[key];
          }
        }
      }
    }
    return target;
  };
}

var clubCarlsonData = JSON.parse(sessionStorage.getItem('giftcardArray'));
var airlineMilesData = JSON.parse(sessionStorage.getItem('airlineMilesArray'));

var redemption = '';
var redemptiontype = '';
var redemptionnumber = '';
var total = 0;
var pointsTotal = 0;

var tsaPoints = ''

if ( clubCarlsonData ) {
clubCarlsonData.forEach(function(element,idx,array){
  if (idx === array.length - 1) {
    redemption += element.title;
  } else {
    redemption += element.title + ' | ';
  }
redemptiontype = element.type;
});

for(var i=0; i < clubCarlsonData.length; i++) {
total += parseInt(clubCarlsonData[i].num);
pointsTotal += parseInt(clubCarlsonData[i].point)*parseInt(clubCarlsonData[i].num);
}
} else if ( airlineMilesData ) {
redemptiontype = 'Airline Miles';
airlineMilesData.forEach(function(element,idx,array){

  if (idx === array.length - 1) {
    redemption += element.cmsId;
  } else {
    redemption += element.cmsId + ' | ';
  }
});

for(var i=0; i < airlineMilesData.length; i++) {
total += parseInt(airlineMilesData[i].quantity);
pointsTotal += parseInt(airlineMilesData[i].point)*parseInt(airlineMilesData[i].quantity);
}
} else if ( getQueryVariable('type') == 'tsa' ) {
redemptiontype = 'TSA Precheck';
redemption = 'TSA65000';
// Note was: total = 1 and  pointsTotal = 65000 which can circumvent what was actual
// as this is tracking it should only track as is and not enforce business rules
}

function getQueryVariable (variable){
var query = window.location.search.substring(1);
query = query.replace("?","&");
var vars = query.split("&");
for (var i=0;i<vars.length;i++) {
var pair = vars[i].split("=");
if(pair[0] == variable){ return pair[1]; }
}
return(false);
}

